import { useEffect, useState } from 'react';
import ParkDetails from './ParkDetails';
import useFetch from './useFetch';
import { Link } from 'react-router-dom';
import { useParams } from "react-router-dom";
import ParkComponent from './ParkComponet';

const ActivityList = () => {
    const { activityId } = useParams();

    const { data: data, isPending, error } = useFetch("https://developer.nps.gov/api/v1/activities/parks?id="+activityId+"&limit=500&api_key=gUeSemHr93mXuKE5WqakVIaO2cDN67aqXettWyDE");
    const dataArr = data.data;
    const parks = dataArr.parks;
    //console.log(activity);
    //console.log('activity in activityList');
    //console.log(parks);
    //const parks = data;
    //const [Activities, setActivities] = useState([]);

    /*const handleActivitySearch = (activity) => {
        const newParks = parks.filter(park => park.activities !== activity);
        setParks(newParks);
    }*/
    return (
        <div className="ParksList">
        <h2>Activity</h2>
            { error && <div>{ error }</div> }
            { isPending && <div>Loading...</div> }
            { parks && (parks.map(function(park, idx)
                    {<ParkDetails parkCode={park.parkCode} />}
            ))};
        </div>
    );

}
export default ActivityList;
